import React from 'react';

class Upvote extends React.Component {

    constructor(props){
        super(props)
        this.state = {
            count: 0
        }
    }

    increment = () => {

        this.setState({
            count: this.state.count + 1
        })
    }

    decrement = () => {

        this.setState({
            count: this.state.count - 1
        })
    }

    render() {
        return (
            <div>

                <i onClick={this.increment} style={{ fontSize: '24px'}} className="fa">&#xf087;</i>
                <span>{this.state.count}</span>

                <i onClick={this.decrement} style={{ fontSize: '24px' }} className="fa">&#xf088;</i>

            </div>
        );
    }
}

export default Upvote;
